import React from 'react';

const Services = () => {
    return (
        <div className='my-28'>
            <div className='text-center text-xl font-bold uppercase'>
                <h2>Our Services</h2>
                <h2>Services   We Provide</h2>
            </div>
        </div>
    );
};

export default Services;
